                                All images referenced here are in the Public Domain and are free for any use commercal or private. Please the Creative Commons Public Domain Mark page for details, http://creativecommons.org/publicdomain/mark/1.0/.\n                            </licence>\n            </availability>\n         </publicationStmt>\n         <notesStmt>\n            <note>Ms. codex.</note>\n            <note>Title supplied by cataloger.</note>\n            <note>Collation: Paper, 131; 1(-1) 2 3 4 5 6 7-9 10(-1) 11-13 14(+1) 15(-2) 16 17; contemporary foliation in red ink, upper center recto, 1-5, 7, 6, 8-53, 53--66, [67], 68-76, 78-94, [i], 95-96 (=f. 2-98); modern foliation in pencil, [v, 1-126], upper right recto. References in this record are to modern foliation. Catchwords on almost every page, lower right recto or verso.</note>\n            <note>Layout: Written in 2 columns of 27 lines (f. 2r-95v) and 2 columns of 6 staves (f. 97v-107v); frame-ruled in red ink with text ruled in lead.</note>\n            <note>Script: Written in a German Gothic script by Georg Keysser (f. 96r).</note>\n            <note>Decoration: 3 full-page borders in colored inks with architectural columns (f. 1v, 54v, 69v); 5-line initial and full scrollwork border in colored inks (f. 2r); 8-line initial in colored inks and first words in display uncials in red ink (f. 84v); 2-line initial in 2 colors and knotwork design in colored inks (f. 96r); 1- to 3-line initials in various colors throughout; rubrication, foliation, and frame-ruling in red ink.</note>\n            <note>Music: Contains Hufnagelschrift notation on 5-line staves in the Office of the Dead (f. 97r-107v), with later additions in square notation on 4-line staves (f. 108r-108v).</note>\n            <note>Binding: Original 16th-century vellum over pasteboard, gold-stamped with stamps of the Annunciation (upper cover) and the Nativity (lower cover) and gold-tooled borders; remnants of 2 pairs of ties.</note>\n            <note>Origin: Written in the Benedictine abbey in Elchingen (Bavaria), in 1596 (f. 96r).</note>\n         </notesStmt>\n         <sourceDesc>\n            <msDesc>\n               <msIdentifier>\n                  <settlement>Philadelphia</settlement>\n                  <institution>University of Pennsylvania</institution>\n                  <repository>Rare Book &amp; Manuscript Library</repository>\n                  <idno>Ms. Codex 1589</idno>\n               </msIdentifier>\n               <msContents>\n                  <summary>Benedictine manuscript containing texts for Matins and Lauds from the Commemorative Office of the Virgin. This version of the Office was said most often on Saturday in place of the usual Office of the day. Also contains the Office of the Dead accompanied by musical notation for the chants. The manuscript once had leather finding tabs flush to the edge of the leaves, all but one (f. 96) of which have been torn out (for example, f. 1, 7, 69).</summary>\n                  <textLang>Latin.</textLang>\n                  <msItem>\n                     <title>Texts for the Commemorative Office of the Virgin Mary and notated Office of the Dead</title>\n                     <author>Catholic Church.</author>\n                     <respStmt>\n                        <resp>scribe</resp>\n                        <persName>Keysser, Georg</persName>\n                     </respStmt>\n                  </msItem>\n                  <msItem n=\"2r\">\n                     <locus>2r</locus>\n                     <title>Antiphona et responsoria et lectiones de commune beate Marie semper virginis..., f. 2r</title>\n                  </msItem>\n                  <msItem n=\"54v\">\n                     <locus>54v</locus>\n                     <title>Lectiones infra tricesimum [assumptionis] beate Mariae semper virginis, f. 54v</title>\n                  </msItem>\n                  <msItem n=\"70r\">\n                     <locus>70r</locus>\n         